// 获取赤峰市所有区的小区和楼栋
// 获取小区
// count = 81 actual = 81 bounds = 61
function getPois(type,location){
    for (var i = 0; i < 5; i++) {
        var page = i + 1;
        request(`https://restapi.amap.com/v3/place/text?key=c7aeb11746b35a92b7b6eee3178a05e4&keywords=&types=${type}&city=${location}&children=1&offset=20&page=${page}&extensions=all`, function (error, response, body) {
            var obj = JSON.parse(body);
            var pois = obj.pois;
            var ids = "";
            console.log(pois);

            pois.forEach(function(poi){
                ids += `{"poiId":"${poi.id}","poiLocation":"${poi.location}","poiLng":"${poi.location.split(",")[0]}","poiLat":"${poi.location.split(",")[1]}","poiName":"${poi.name}","poiType":"${poi.type}","poiAddress":"${poi.address}","poiBounds":"null","poiPcode":"${poi.pcode}","poiPname":"${poi.pname}","poiCitycode":"${poi.citycode}","poiCityname":"${poi.cityname}","poiAdcode":"${poi.adcode}","poiAdname":"${poi.adname}","poiRegion":"${poi.pname}/${poi.cityname}/${poi.adname}"},`;
            });
            fs.appendFile("./pois.txt", ids, (error)=> {
                if (error) return console.log("追加文件失败" + error.message);
                console.log("追加成功");
            });
        });
    }
}

